import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
    FirstView2,
    BigText2
} from "../componenets/fintech3Style"

export default function Fintech3({navigation}){
    return(
        <SafeAreaView style={styles.fintech3container}>
            <ScrollView>
                <FirstView2>
                <TouchableOpacity style={styles.back1} onPress={()=>navigation.navigate("Fintech1")}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad2}/> 
                    </TouchableOpacity>
                   <BigText2 style={styles.pad3}>Procurement</BigText2>
                </FirstView2>
            </ScrollView>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
 fintech3container: {
    backgroundColor: "#000",
    paddingTop: 25,
    flex: 1,
 },
 back1: {
    padding: 10,
 },
 pad2: {
    paddingLeft: 20
 },
 pad3: {
    paddingLeft: 69,
 }
});
